import React, { useState } from 'react';
import ABTestService from '../../services/api';
import { ABTestFormData } from '../../services/types';
import { v4 as uuidv4 } from 'uuid';
import { Button, TextField, Container, Box, Typography } from '@material-ui/core';

interface CreateTestProps {
  setTestId: React.Dispatch<React.SetStateAction<string | null>>;
}

const CreateTest: React.FC<CreateTestProps> = ({ setTestId }) => {
  const [formData, setFormData] = useState<ABTestFormData>({
    test_id: uuidv4(),
    visitors: 0,
    sample_size: 0,
    start_date: '',
    end_date: '',
    variant_identifier: '',
    control_identifier: '',
    variant_segment: 0,
    control_segment: 0,
    website: '',
  });

  const handleInputChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = event.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (event: React.FormEvent<HTMLFormElement>) => {
    event.preventDefault();

    // Check if variant and control segments add up to 100
    const variantSegment = +formData.variant_segment;
    const controlSegment = +formData.control_segment;

    if (variantSegment + controlSegment !== 100) {
      alert('The sum of the variant and control segments should equal 100');
      return;
    }

    try {
      await ABTestService.createTest(formData);
      setTestId(formData.test_id);
      alert('Test created successfully');
    } catch (error) {
      console.error('Error creating test:', error);
      alert ('Failed to create test');
    }
    };
    

    return (
      <Container maxWidth="sm">
      <Typography variant="h4" component="h1" gutterBottom>
        Create Test
      </Typography>
      <form noValidate autoComplete="off" onSubmit={handleSubmit}>
        <Box mb={3}>
          <Typography variant="h5" component="h2">
            General Information
          </Typography>
          <TextField
            id="website"
            label="Site Name"
            name="website"
            value={formData.website}
            onChange={handleInputChange}
            variant="outlined"
            helperText="Please enter the website name"
            InputLabelProps={{
              shrink: true,
            }}
            required
            fullWidth
          />
          <TextField
            id="visitors"
            label="Visitors"
            name="visitors"
            type="number"
            value={formData.visitors}
            onChange={handleInputChange}
            variant="outlined"
            helperText="Please enter the expected number of visitors."
            InputLabelProps={{
              shrink: true,
            }}
            required
            fullWidth
          />
          <TextField
            id="sample_size"
            label="Sample Size"
            name="sample_size"
            type="number"
            value={formData.sample_size}
            onChange={handleInputChange}
            variant="outlined"
            helperText="Please enter the sample size."
            InputLabelProps={{
              shrink: true,
            }}
            required
            fullWidth
          />
          <TextField
            id="start_date"
            label="Start Date"
            name="start_date"
            type="datetime-local"
            value={formData.start_date}
            onChange={handleInputChange}
            variant="outlined"
            helperText="Please specify the test's start date."
            InputLabelProps={{
              shrink: true,
            }}
            required
            fullWidth
          />
          <TextField
            id="end_date"
            label="End Date"
            name="end_date"
            type="datetime-local"
            value={formData.end_date}
            onChange={handleInputChange}
            variant="outlined"
            required
            fullWidth
            helperText="Please specify the test's end date."
            InputLabelProps={{
              shrink: true,
            }}
          />
        </Box>

        <Box mb={3}>
          <Typography variant="h5" component="h2">
            A/B Test Details
          </Typography>
          <TextField
            id="variant_identifier"
            label="Variant Identifier"
            name="variant_identifier"
            value={formData.variant_identifier}
            onChange={handleInputChange}
            variant="outlined"
            helperText="Please enter the variant identifier."
            InputLabelProps={
              {
                shrink: true,

            }}
            required
            fullWidth
          />
          <TextField
            id="control_identifier"
            name="control_identifier"
            value={formData.control_identifier}
            onChange={handleInputChange}
            variant="outlined"
            helperText="Please enter the control identifier."
            InputLabelProps={{
              shrink: true,
            }}
            required
            fullWidth
          />
          <TextField
            id="variant_segment"
            name="variant_segment"
            type="number"
            value={formData.variant_segment}
            onChange={handleInputChange}
            variant="outlined"
            helperText="Please enter the variant segment."
            InputLabelProps={{
              shrink: true,
            }}
            required
            fullWidth
          />
          <TextField
            id="control_segment"
            name="control_segment"
            type="number"
            value={formData.control_segment}
            onChange={handleInputChange}
            variant="outlined"
            required
            fullWidth
          />
        </Box>

        <Box>
          <Button variant="contained" color="primary" type="submit">
            Create Test
          </Button>
        </Box>
      </form>
    </Container>
  );
};

export default CreateTest;
